import './App.css';
import { BrowserRouter, Route, Switch } from 'react-router-dom';
import Home from './pages/Home';
import Reviews from './pages/Reviews';


function App() {
    return (
        <div>
            <BrowserRouter>
                <Switch>
                    <Route path="/">
                        <Home />
                    </Route>
                    <Route path="/reviews">
                    </Route>
                </Switch>
            </BrowserRouter>
        </div>
    );
}

export default App;
